import { Form } from "react-router-dom";
import { Card, CardBody, Input } from "reactstrap";

const AddPost = () => {
  return (
    <div className="wrapper">
      <Card>
        <CardBody>
          <h3> Whats on you Mind</h3>
          <Form>
            <div className="my-3">
              <Label for="title">Post Title</Label>
              <Input type="text" id="title">
              
              </Input>
            </div>
          </Form>
        </CardBody>
      </Card>
    </div>
  );
};
export default AddPost;
